const Table = ({ infoTable }) => {

  const result = infoTable.map((el) => {
    if (el.id === 1) {
      return <thead>
        <tr>
          <td><input type="checkbox" /></td>
          <th>{el.product}</th>
          <th>{el.nameP}</th>
        </tr>
      </thead>
    } else {
      return <tbody>
        <tr>
          <td><input type="checkbox" /></td>
          <td>{el.product}</td>
          <td>{el.nameP}</td>
        </tr>
      </tbody>
    }
  })

  return (
    <div style={{ overflow: "auto" }}>
      <table className='table-dashboard' >
        {result}
      </table>
    </div>
  )
}

export default Table;
